function nomeTabsSaicafe(tipo) {
	
	switch (tipo) {
		case 1: 
			return { 
				tabSaicafe1: "Dados",
				tabSaicafe2: "Despejo",
				tabSaicafe3: "Observações"
			};
			
			break;
		case 2: 
			return { 
				tabSaicafe1: "Dados",
				tabSaicafe2: "Despejo",
				tabSaicafe3: "Cobrança"
			};

			break;
	}
	
}
